Calculadora de IMC: Crie uma função chamada calcula_imc que recebe o peso (em quilogramas) e a altura (em metros) de uma pessoa como argumentos e calcula o Índice de Massa Corporal (IMC). Com base no IMC calculado, a função deve retornar uma mensagem que classifica a pessoa em uma das seguintes categorias: “Abaixo do Peso”, “Peso Normal”, “Sobrepeso” ou “Obesidade”.


calcula_imc &lt;- function(peso, altura) {
  # Calcular o IMC
  imc &lt;- peso / altura^2

  # Classificar com base no IMC
  if (imc &lt; 18.5) {
    return("Abaixo do Peso")
  } else if (imc &gt;= 18.5 && imc &lt; 25) {
    return("Peso Normal")
  } else if (imc &gt;= 25 && imc &lt; 30) {
    return("Sobrepeso")
  } else {
    return("Obesidade")
  }
}

# Exemplo de uso da função
peso_exemplo &lt;- 70  # em kg
altura_exemplo &lt;- 1.75  # em metros

mensagem_classificacao &lt;- calcula_imc(peso_exemplo, altura_exemplo)

cat("Peso:", peso_exemplo, "kg\n")

Peso: 70 kg

cat("Altura:", altura_exemplo, "m\n")

Altura: 1.75 m

cat("Classificação:", mensagem_classificacao, "\n")

Classificação: Peso Normal

