Crie uma função que calcule os n primeiros números da sequência de Fibonacci. A sequência de Fibonacci começa com 0 e 1, e os números subsequentes são a soma dos dois anteriores (0, 1, 1, 2, 3, 5, 8, …).


calcular_fibonacci &lt;- function(n) {
  fibonacci_sequence &lt;- numeric(n)

  if (n &gt;= 1) {
    fibonacci_sequence[1] &lt;- 0
  }
  if (n &gt;= 2) {
    fibonacci_sequence[2] &lt;- 1
  }

  for (i in 3:n) {
    fibonacci_sequence[i] &lt;- fibonacci_sequence[i - 1] + fibonacci_sequence[i - 2]
  }

  return(fibonacci_sequence)
}

# Exemplo de uso
n &lt;- 10
resultado &lt;- calcular_fibonacci(n)
cat("Os primeiros", n, "números da sequência de Fibonacci são:", resultado, "\n")

