2. Considere uma matriz m×m, em que m é um inteiro positivo. Implemente uma função em R que realize a varredura de uma matriz e execute uma operação específica que depende do valor encontrado na matriz, conforme as seguintes regras:
• Se o valor for um número primo, multiplique-o por 8. • Se o valor for um quadrado perfeito, subtraia 19. Caso o resultado obtido for negativo, eleve a 7a potência. • Se o valor for negativo na matriz original, calcule a raiz 3a de seu módulo. • Para todos os outros valores, não faça nada.
A função a ser criada deve retornar a matriz transformada. Considere: * Matriz A: |A |B |C |D | |–|–|—|–| |3 |-3|6 |-8| |1 |2 |-10|-7| |8 |-2|-9 |-4| |10|-5|-1 |7 |

